    constructor(props){
       super(props); 
    }

    render(){
       return (
        <div>
           <div id="clear">AC</div>
           <div id="divide">/</div>
           <div id="multiply">*</div>
           <div id="substract">-</div>
           <div id="add">+</div>
           <div id="equal">=</div>
        </div>
       ); 
    }
}


export default ControlsButtons;
